1025	Events::NoteOnWorkspace	6	\N	\N	2014-07-02 16:32:17.799	2014-07-02 16:32:17.799	\N	\N	{"body":"Hi All,<div><br></div><div>I've spent some time doing a review of Xiti and the data audit side of Leroy Merlin. &nbsp;I'll post the data audit here in the coming days. &nbsp;I wanted to put a note up about the Xiti portion.</div><div><br></div><div>Our initial review of the API has been positive. &nbsp;We've been able to access it with the credentials that you've provided and have been able to pull data with it. &nbsp;We do not see a technical hurdle with integrating this data.</div><div><br></div><div>At a high level, our integration development plan is as follows:</div><div><br></div><div>- Setup credential tracking to use with API</div><div>- Setup data extracts in Xiti for use</div><div>- Generate a daily call to the API that will pass the credentials and the data extract to pull along with variables indicate the date range and the row numbers to pull (multiple calls can be used to pull larger data sets requiring the row numbers)</div><div>- A process will take the returned JSON file and convert it into a CSV. This will be placed in our staging environment</div><div>- Our scheduled process will then find the newly created files and perform a load of this data into Artemis</div><div>- A new Artemis insight will be generated to access this data set and share it in dashboards or other work.</div><div><br></div><div>What we do need now is to begin to specify templates for use in Xiti that can be pulled over. &nbsp;We'll also need to setup some generic queries in Xiti using these templates. &nbsp;In my initial review, I've found that we have 2-3 different standard pulls it seems:</div><div><br></div><div>- Campaign performance:</div><div><span class=\\"dh_dimensionsDescription\\" title=\\"Dimensions: Date Campaigns\\">Dimensions: Date Campaigns</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\">metrics: Visits, Pageviews / visits, time spent / visits</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\"><br></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\">- Time of day site access:</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\">Dimensions: Date, Hours(early access), Platformer, entrance Pages</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\">Metrics: Views , Conversions(visits)</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\"><br></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\">-Search (Paid):</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\"><span>Dimensions: Date, Campaigns, Ad Groups</span></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Pageviews / visits, time spent / visits\\"><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\"><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Time spent cumulatively, Pageviews, Incoming Visits\\">Metrics: Visits, Time spent cumulatively, Pageviews, Incoming&nbsp;</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Time spent cumulatively, Pageviews, Incoming Visits\\"><br></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Time spent cumulatively, Pageviews, Incoming Visits\\">-Search (Organic):</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Time spent cumulatively, Pageviews, Incoming Visits\\"><span class=\\"dh_dimensionsDescription\\" title=\\"Dimensions: Date, Hours (early access), Motors, Pages Input\\">Dimensions: Date, Hours (early access), Motors, entrance Pages</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">Metrics: Views, Conversions (visits)</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\"><br></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">The queries themselves are then broken out by the site that they're targeting: Desktop vs Mobile. &nbsp;</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">I believe from this review we can begin to reduce the queries and formats, quite possibly adding additional fields and then</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">have bulk uploads of the data to our platform.</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\"><br></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">What we need now is to identify these formats that we need and setup the queries to pull regularly. &nbsp;Who can be help with identifying these aspects?</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\"><br></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">Cheers,</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\">Doug</span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Conversions (visits)\\"><br></span></span><span class=\\"dh_metricsDescription\\" title=\\"Metrics: Visits, Time spent cumulatively, Pageviews, Incoming Visits\\"><br></span></span></span></div>"}	18	\N	\N	\N	f	\N	\N	f	\N	\N
